import React from 'react';

function App() {
  let likes = 5;
  return (
    <div className="App">
      <h1>{likes}</h1>
     <button onClick={() => likes+=1}>-</button>
     <button onClick={() => likes-=1}>+</button>
    </div>
  );
}

export default App;
